class UniChar {
public:
	u32 codepoint;
	u8 featureValid;
    Feature feature;

	//UniChar fromCache(Strategy next, u16 cp, u8 needFeature);
	UniChar();

	void copyFrom(UniChar* srcChar);

	int fromCharCode(u32 cp, u8 needFeature);

	u8 isHighSurrogate(u32 cp);

	u8 isLowSurrogate(u32 cp);

	int prepFeature();

	int getDecomp(int* S);

	u8 isCompatibility();

	u8 isExclude();

	u8 getCanonicalClass();

	int getComposite(UniChar* compositeChar, UniChar* followingChar);

};

class UniCharIterator{
public:
	int cursor;
	u32* unicodeArray;
	u16 unicodeArrayLen;

	UniCharIterator(u32* arr, u16 len);

	int next(u32* nextCP);
};

class RecursDecompIterator {
public:
	UniCharIterator* it;
	u8 canonical;
	UniChar* resBuf;
	u16 resBufLen;
	u16 resBufValidLen;
	
	int cursor;
    int skipCursor;
	int shouldSkipCount;
	u32 lastCP;

	RecursDecompIterator(UniCharIterator* it, u8 cano, UniChar* buf, u16 len);

	int recursiveDecomp(u8 cano, UniChar* uniChar);

	int next(UniChar* nextChar);
};

class DecompIterator {
public:
	RecursDecompIterator* it;
	
	UniChar* resBuf;
	u16 resBufLen;
	u16 resBufValidLen;
	
	int cursor;

	DecompIterator(RecursDecompIterator* it, UniChar* buf, u16 len);

	int next(UniChar* nextChar);
};

class CompIterator {
public:
	DecompIterator* it;
	
	u32* resBuf;
	u16 resBufLen;
	u16 resBufValidLen;

	UniChar* procBuf;
	u16 procBufLen;
	u16 procBufValidLen;

	u8 lastClass;
	
	int cursor;

	CompIterator(DecompIterator* it, u32* buf,u16 bufLen, UniChar* procBuf, u16 procBufLen  );

	int next(u32* nextCharCP);
};

enum UnicodeNormalizeType
{
	NFC = 0,
	NFD,
	NFKC,
	NFKD
};

class Normalizer {
public:
	//nfc, nfkc
	int normalizeNFxC(u32* unicodeArr, u16 len, u32* resultArr,u16 resultLimit, u16* resultLen, UnicodeNormalizeType type);

	//nfd, nfkd
	int normalizeNFxD(u32* unicodeArr, u16 len, u32* resultArr,u16 resultLimit, u16* resultLen, UnicodeNormalizeType type);

	void test();
};

